module.exports = JSON.parse("{\"url\":\"/services\",\"title\":\"Our Services\",\"description\":\"Aristo and our partners carry products from various Canadian financial institutions. However, we do not simply sell products. Our experienced advisors carefully consider every client’s unique situation and assist in establishing a complete financial plan which involves tax savings, wealth protection and accumulation, and much more.\",\"template\":\"other\",\"content\":{\"hero\":{\"imagePath\":\"services/hero.jpg\",\"title\":\"We custom tailor our solutions to match your unique needs\",\"secondaryTitle\":\"More than just products\",\"text\":\"Aristo and our partners carry products from various Canadian financial institutions. However, we do not simply sell products. Our experienced advisors carefully consider every client’s unique situation and assist in establishing a complete financial plan which involves tax savings, wealth protection and accumulation, and much more. Click into each service category below to learn about our offerings.\"},\"statement\":{\"title\":\"Didn’t find what you need?\",\"text\":\"The services listed are just some of our popular offerings. We carefully analyze your personal and/or business situation to help you create, customize and implement the most appropriate financial solution. Contact us today to set up a consultation.\",\"cta\":{\"label\":\"Setup a Meeting\",\"src\":\"/contact\"}},\"endHero\":{\"imagePath\":\"services/hero-end.jpg\",\"title\":\"Jumpstart your future today, let us help you reach your goals\",\"text\":\"Schedule a meeting with us today to facilitate in identifying and reaching your goals.\",\"cta\":{\"label\":\"Setup a Meeting\",\"src\":\"/contact\"}}}}");

