module.exports = JSON.parse("{\"data\":[{\"text\":\"I had no idea how to invest all my life. I left money at the bank and GICs earning very little interest. My advisor taught me about investments and educated me that investing involves volatility, but is the only way to make a good return, and in the long run I did in fact make a very good annual return. I can’t be any happier.\",\"author\":\"Winnie Kong\"},{\"text\":\"For the last 40 years of my life I had no idea what I was doing with my finances. I had little savings and a lot of debt. An advisor from Trilliant helped me to reduce my debt, increase my savings and investments, and now I feel much more comfortable heading into retirement. I wouldn’t know what I would do now if I hadn’t gone through with the financial planning, so I am very thankful.\",\"author\":\"Angela Chow\"},{\"text\":\"My advisor taught me the importance of establishing a good savings/investing habit. I started with contributing a small amount every month and after a few years I noticed that there was a good chunk of money in my investment accounts, which helped with providing a down payment to secure my first real estate purchase. I am glad I listened to my advisor’s advice! \",\"author\":\"Herman Lee\"},{\"text\":\"I’m happy that I went through with the insurance plans my advisor recommended. When an unexpected illness happened in my family, we were very thankful that the insurance paid out, so my husband could focus on recovering. He’s much better now; we can’t imagine what we would’ve done if we had to deal with financial stress at that time as well.\",\"author\":\"Shiela Niu\"}]}");

